// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awTabSetRenderFunction } from 'js/AwTabSetService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwTabSetService', () => import('js/AwTabSetService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awTabSetRenderFunction",
            "deps": "js/AwTabSetService"
        },
        "updateTabSelection": {
            "actionType": "JSFunction",
            "method": "updateTabSelection",
            "inputData": {
                "tabs": "{{data}}"
            },
            "deps": "js/AwTabSetService"
        }
    },
    "data": {
        "tabsModel": [],
        "manualTabSelection": false
    },
    "props": {
        "tabs": {
            "type": "object"
        },
        "update-hook": {
            "type": "object"
        },
        "tab-set-id": {
            "type": "string"
        },
        "action": {
            "type": "action"
        },
        "sub-panel-context": {
            "type": "object"
        },
        "close-action": {
            "type": "action"
        }
    },
    "conditions": {},
    "onEvent": [
        {
            "eventId": "awTab.setSelected",
            "action": "updateTabSelection",
            "cacheEventData": true
        }
    ],
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "AwTabSet",
    "_uniqueViewModelId": "AwTabSet"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awTabSetRenderFunction, undefined, ctxImportObj );

export default Component;
